a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1561_%D0%B3%D0%BE%D0%B4\" title=\"1561 \u0433\u043e\u0434\">1561<\/a>&#160;\u2014 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%BE%D1%81%D0%BA%D0%B2%D0%B0\" title=\"\u041c\u043e\u0441\u043a\u0432\u0430\">\u041c\u043e\u0441\u043a\u0432\u0435<\/a> \u043d\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D1%80%D0%B0%D1%81%D0%BD%D0%B0%D1%8F_%D0%BF%D0%BB%D0%BE%D1%89%D0%B0%D0%B4%D1%8C\" title=\"\u041a\u0440\u0430\u0441\u043d\u0430\u044f \u043f\u043b\u043e\u0449\u0430\u0434\u044c\">\u041a\u0440\u0430\u0441\u043d\u043e\u0439 \u043f\u043b\u043e\u0449\u0430\u0434\u0438<\/a> \u0437\u0430\u0432\u0435\u0440\u0448\u0435\u043d\u043e \u0441\u0442\u0440\u043e\u0438\u0442\u0435\u043b\u044c\u0441\u0442\u0432\u043e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A5%D1%80%D0%B0%D0%BC_%D0%92%D0%B0%D1%81%D0%B8%D0%BB%D0%B8%D1%8F_%D0%91%D0%BB%D0%B0%D0%B6%D0%B5%D0%BD%D0%BD%D0%BE%D0%B3%D0%BE\" title=\"\u0425\u0440\u0430\u043c \u0412\u0430\u0441\u0438\u043b\u0438\u044f \u0411\u043b\u0430\u0436\u0435\u043d\u043d\u043e\u0433\u043e\">\u0445\u0440\u0430\u043c\u0430 \u0412\u0430\u0441\u0438\u043b\u0438\u044f \u0411\u043b\u0430\u0436\u0435\u043d\u043d\u043e\u0433\u043e<\/a> .<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1613_%D0%B3%D0%BE%D0%B4\" title=\"1613 \u0433\u043e\u0434\">1613<\/a>&#160;\u2014 \u0432\u043e \u0432\u0440\u0435\u043c\u044f \u043f\u0440\u0435\u043c\u044c\u0435\u0440\u044b \u00ab\u0413\u0435\u043d\u0440\u0438\u0445\u0430 VIII\u00bb <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A8%D0%B5%D0%BA%D1%81%D0%BF%D0%B8%D1%80,_%D0%A3%D0%B8%D0%BB%D1%8C%D1%8F%D0%BC\" title=\"\u0428\u0435\u043a\u0441\u043f\u0438\u0440, \u0423\u0438\u043b\u044c\u044f\u043c\">\u0428\u0435\u043a\u0441\u043f\u0438\u0440\u0430<\/a> \u0441\u0433\u043e\u0440\u0435\u043b <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A2%D0%B5%D0%B0%D1%82%D1%80_%D0%93%D0%BB%D0%BE%D0%B1%D1%83%D1%81\" class=\"mw-redirect\" title=\"\u0422\u0435\u0430\