3d\u0438\u044f. \u041e\u0431\u0449\u0435\u0435 \u0440\u0443\u043a\u043e\u0432\u043e\u0434\u0441\u0442\u0432\u043e \u0433\u043e\u0440\u043e\u0434\u0441\u043a\u0438\u043c \u0445\u043e\u0437\u044f\u0439\u0441\u0442\u0432\u043e\u043c, \u0430 \u0442\u0430\u043a\u0436\u0435 \u043e\u0431\u0440\u0430\u0437\u043e\u0432\u0430\u043d\u0438\u0435\u043c \u0438 \u0437\u0434\u0440\u0430\u0432\u043e\u043e\u0445\u0440\u0430\u043d\u0435\u043d\u0438\u0435\u043c \u0441\u0442\u0430\u043b\u043e \u043e\u0441\u0443\u0449\u0435\u0441\u0442\u0432\u043b\u044f\u0442\u044c\u0441\u044f \u0433\u043e\u0440\u043e\u0434\u0441\u043a\u0438\u043c\u0438 \u0434\u0443\u043c\u0430\u043c\u0438 \u043f\u043e\u0434 \u043a\u043e\u043d\u0442\u0440\u043e\u043b\u0435\u043c \u043f\u0440\u0430\u0432\u0438\u0442\u0435\u043b\u044c\u0441\u0442\u0432\u0435\u043d\u043d\u044b\u0445 \u043e\u0440\u0433\u0430\u043d\u043e\u0432.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1880_%D0%B3%D0%BE%D0%B4\" title=\"1880 \u0433\u043e\u0434\">1880<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A4%D1%80%D0%B0%D0%BD%D1%86%D0%B8%D1%8F\" title=\"\u0424\u0440\u0430\u043d\u0446\u0438\u044f\">\u0424\u0440\u0430\u043d\u0446\u0438\u044f<\/a> \u043f\u0440\u0438\u0441\u043e\u0435\u0434\u0438\u043d\u0438\u043b\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A2%D0%B0%D0%B8%D1%82%D0%B8\" title=\"\u0422\u0430\u0438\u0442\u0438\">\u0422\u0430\u0438\u0442\u0438<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1881_%D0%B3%D0%BE%D0%B4\" title=\"1881 \u0433\u043e\u0434\">1881<\/a>&#160;\u2014 \u0441\u0443\u0434\u0430\u043d\u0441\u043a\u0438\u0439 \u043f\u0440\u043e\u043f\u043e\u0432\u0435\u0434\u043d\u0438\u043a <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D1%83%D1%85%D0%B0%D0%BC%D0%BC%D0%B5%D0%B4_%D0%90%D1%85%D0%BC%D0%B5%D0%B4\" class=\"mw-redirect\" title=\"\u041c\u0443\u0445\u0430\u043c\u043c\u0435\u0434 \u0410\u0445\u043c\u0435\u0434\">\u041c\u0443\u0445\u0430\u043c\u043c\u0435\u0434 \u0410\u0445\u043c\u0435\u0434<\/a> \u043f\u0440\u043e\u0432\u043e\u0437\u0433\u043b\u0430\u0441\u0438\u043b \u0441\u0435\u0431\u044f <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%B0%D1%85%D0%B4%D0%B8\" title=\"\u041c\u0430\u0445\u0434\u0438\">\u043c\u0430\u0445\u0434\u0438<\/a> (\u0432 \u043f\u0435\u0440\u0435\u0432\u043e\u0434\u0435 \u0441 \u0430\u0440\u0430\u0431\u0441\u043a\u043e\u0433\u043e \u00ab\u0432\u0435\u0434\u043e\u043c\u044b\u0439 \u0438\u0441\u0442\u0438\u043d\u043d\u044b\u043c \u043f\u0443\u0442\u0451\u043c\u00bb), \u0442\u043e \u0435\u0441\u0442\u044c \u043c\u0435\u0441\u0441\u0438\u0435\u0439, \u0441\u043f\u0430\u0441\u0438\u0442\u0435\u043b\u0435\u043c, \u0438 \u0432\u043e\u0437\u0433\u043b\u0430\u0432\u0438\u043b \u0432\u043e\u0441\u0441\u0442\u0430\u043d\u0438\u0435 \u043a\u0440\u0435\u0441\u0442\u044c\u044f\u043d \u0438 \u043a\u043e\u0447\u0435\u0432\u043d\u0438\u043a\u043e\u0432 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D1%83%D0%B4%D0%B0%D0%BD\" title=\"\u0421\u0443\u0434\u0430\u043d\">\u0421\u0443\u0434\u0430\u043d\u0435<\/a> \u043f\u0440\u043e\u0442\u0438\u0432 \u043f\u0440\u043e\u0438\u0437\u0432\u043e\u043b\u0430 \u0433\u0443\u0431\u0435\u0440\u043d\u0430\u0442\u043e\u0440\u043e\u0432-\u0435\u0432\u0440\u043e\u043f\u0435\u0439\u0446\u0435\u0432.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1882_%D0%B3%D0%BE%D0%B4\" title=\"1882 \u0433\u043e\u0434\">1882<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D1%83%D0%BA%D1%83%D0%B5%D0%B2%D1%81%D0%BA%D0%B0%D1%8F_%D0%BA%D0%B0%D1%82%D0%B0%D1%81%D1%82%D1%80%D0%BE%D1%84%D0%B0\" title=\"\u041a\u0443\u043a\u0443\u0435\u0432\u0441\u043a\u0430\u044f \u043a\u0430\u0442\u0430\u0441\u0442\u0440\u043e\u0444\u0430\">\u041a\u0443\u043a\u0443\u0435\u0432\u0441\u043a\u0430\u044f \u0436\u0435\u043b\u0435\u0437\u043d\u043e\u0434\u043e\u0440\u043e\u0436\u043d\u0430\u044f \u043a\u0430\u0442\u0430\u0441\u0442\u0440\u043e\u0444\u0430<\/a><\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/