amp;redlink=1\" class=\"new\" title=\"\u0424\u0435\u0440\u043c\u0435\u043d \u043f\u0440\u043e\u0442\u0438\u0432 \u0448\u0442\u0430\u0442\u0430 \u0414\u0436\u043e\u0440\u0434\u0436\u0438\u044f (\u0441\u0442\u0440\u0430\u043d\u0438\u0446\u0430 \u043e\u0442\u0441\u0443\u0442\u0441\u0442\u0432\u0443\u0435\u0442)\">\u0424\u0435\u0440\u043c\u0435\u043d \u043f\u0440\u043e\u0442\u0438\u0432 \u0448\u0442\u0430\u0442\u0430 \u0414\u0436\u043e\u0440\u0434\u0436\u0438\u044f<\/a>\u00bb \u0412\u0435\u0440\u0445\u043e\u0432\u043d\u044b\u0439 \u0441\u0443\u0434 \u043f\u043e\u0441\u0442\u0430\u043d\u043e\u0432\u0438\u043b, \u0447\u0442\u043e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%BC%D0%B5%D1%80%D1%82%D0%BD%D0%B0%D1%8F_%D0%BA%D0%B0%D0%B7%D0%BD%D1%8C\" title=\"\u0421\u043c\u0435\u0440\u0442\u043d\u0430\u044f \u043a\u0430\u0437\u043d\u044c\">\u0441\u043c\u0435\u0440\u0442\u043d\u0430\u044f \u043a\u0430\u0437\u043d\u044c<\/a> \u043f\u0440\u043e\u0442\u0438\u0432\u043e\u0440\u0435\u0447\u0438\u0442 \u043a\u043e\u043d\u0441\u0442\u0438\u0442\u0443\u0446\u0438\u0438.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1973_%D0%B3%D0%BE%D0%B4\" title=\"1973 \u0433\u043e\u0434\">1973<\/a><ul><li>\u0417\u0430\u043f\u0443\u0449\u0435\u043d\u0430 \u041a\u043e\u043b\u044c\u0441\u043a\u0430\u044f \u0410\u042d\u0421, \u043f\u0435\u0440\u0432\u0430\u044f \u0432 \u043c\u0438\u0440\u0435 \u0430\u0442\u043e\u043c\u043d\u0430\u044f \u044d\u043b\u0435\u043a\u0442\u0440\u043e\u0441\u0442\u0430\u043d\u0446\u0438\u044f \u0437\u0430 \u0421\u0435\u0432\u0435\u0440\u043d\u044b\u043c \u043f\u043e\u043b\u044f\u0440\u043d\u044b\u043c \u043a\u0440\u0443\u0433\u043e\u043c.<\/li><li>\u041a\u043e\u043d\u0446\u0435\u0440\u0442 \u00abDeep Purple\u00bb \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9E%D1%81%D0%B0%D0%BA%D0%B0_(%D0%B3%D0%BE%D1%80%D0%BE%D0%B4)\" class=\"mw-redirect\" title=\"\u041e\u0441\u0430\u043a\u0430 (\u0433\u043e\u0440\u043e\u0434)\">\u041e\u0441\u0430\u043a\u0435<\/a> (<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%AF%D0%BF%D0%BE%D0%BD%D0%B8%D1%8F\" title=\"\u042f\u043f\u043e\u043d\u0438\u044f\">\u042f\u043f\u043e\u043d\u0438\u044f<\/a>) \u0441\u0442\u0430\u043b \u0438\u0445 \u043f\u043e\u0441\u043b\u0435\u0434\u043d\u0438\u043c \u0432\u044b\u0441\u0442\u0443\u043f\u043b\u0435\u043d\u0438\u0435\u043c \u0432 \u043a\u043b\u0430\u0441\u0441\u0438\u0447\u0435\u0441\u043a\u043e\u043c \u0441\u043e\u0441\u0442\u0430\u0432\u0435 \u043d\u0430\u0447\u0430\u043b\u0430 70-\u0445 \u0433\u0433. <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D0%B8%D0%BB%D0%BB%D0%B0%D0%BD,_%D0%98%D1%8D%D0%BD\" title=\"\u0413\u0438\u043b\u043b\u0430\u043d, \u0418\u044d\u043d\">\u0418\u044d\u043d \u0413\u0438\u043b\u043b\u0430\u043d<\/a> \u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D0%BB%D0%BE%D0%B2%D0%B5%D1%80,_%D0%A0%D0%BE%D0%B4%D0%B6%D0%B5%D1%80\" title=\"\u0413\u043b\u043e\u0432\u0435\u0440, \u0420\u043e\u0434\u0436\u0435\u0440\">\u0420\u043e\u0434\u0436\u0435\u0440 \u0413\u043b\u043e\u0432\u0435\u0440<\/a> \u0432\u043d\u043e\u0432\u044c \u0441\u043e\u0435\u0434\u0438\u043d\u0438\u043b\u0438\u0441\u044c \u0441 \u0433\u0440\u0443\u043f\u043f\u043e\u0439 \u043b\u0438\u0448\u044c \u0432 1984 \u0433\u043e\u0434\u0443.<\/li><li>\u0412 \u0427\u0438\u043b\u0438 \u043f\u0440\u043e\u0438\u0437\u043e\u0448\u043b\u0430 \u043f\u043e\u043f\u044b\u0442\u043a\u0430 \u0432\u043e\u0435\u043d\u043d\u043e\u0433\u043e \u043f\u0435\u0440\u0435\u0432\u043e\u0440\u043e\u0442\u0430, \u0438\u0437\u0432\u0435\u0441\u0442\u043d\u0430\u044f \u043a\u0430\u043a \u00ab<a href=\"https:\/\/ru.wikipedia.org\/w\/index.php?title=%D0%A2%D0%B0%D0%BD%D0%BA%D0%B0%D1%81%D0%BE&amp;action=edit&amp;redlink=1\" class=\"new\" title=\"\u0422\u0430\u043d\u043a\u0430\u0441\u043e (\u0441\u0442\u0440\u0430\u043d\u0438\u0446\u0430 \u043e\u0442\u0441\u0443\u0442\u0441\u0442\u0432\u0443\u0435\u0442)\">\u0442\u0430\u043d\u043a\u0430\u0441\u043e<\/a>\u00bb.<\/li><\/ul><\/li><li><a href=\"https:\/\/ru.wik